import React from 'react';
import { EventsList } from '../TextInfo';
import '../App.css';
import EventsBlock from '../components/EventsBlock';


const Events = () => {
    return (
        <span className="container_pages container_exp">
            <span className='exp_list events_list'>
                {EventsList.map( ( item, index ) => {
                    return (
                        <span className="exp_item" key={index}>

                            <EventsBlock item={item} />
                        </span>

                    );
                } )}
            </span>
            <div style={{ display: "flex", justifyContent: "center", marginBottom: "5vh" }}>
                <Swipe for="sustain" />
            </div>
        </span>
    );
}
export default Events
